import { Header, Favorites, Filter, List } from '../Components'

const Dashboard = () => {
    return(
        <div className='flex flex-col h-screen'>
            <Filter />
            <div className='flex grow'>
                <Favorites />
                <List />
            </div>
        </div>
    )
}

export default Dashboard
